import React, { useState } from "react";

const login = () => {
  const { proc, setProc } = useState(1);
  return (
    <>
      <h1>CYWORLD</h1>
      <form>
        <input type="text" />
        <input type="password" />
        {
          (proc = 1 ? (
            <>
              <input type="submit" value="확인" /> <button>회원가입</button>
            </>
          ) : (
            <>
              <input type="submit" value="확인" /> <button>로그인</button>
            </>
          ))
        }
      </form>
    </>
  );
};

export default login;
